INSERT INTO `docs` VALUES (18,'Server Roles',_binary '<p><span style=\"background-color: transparent;\">Virtual Servers (Dell VxRail)</span></p><p><span style=\"background-color: transparent;\">ClockWise</span></p><p><span style=\"background-color: transparent;\">DC1</span></p><p><span style=\"background-color: transparent;\">Secondary Domain Controller</span></p><p><span style=\"background-color: transparent;\">Secondary DNS Server</span></p><p><span style=\"background-color: transparent;\">Print</span></p><p><span style=\"background-color: transparent;\">AD Print Server</span></p><p><span style=\"background-color: transparent;\">Papercut Server</span></p><p><span style=\"background-color: transparent;\">ROI Print Control</span></p><p><span style=\"background-color: transparent;\">Rhyem Server</span></p><p><span style=\"background-color: transparent;\">SCCM</span></p><p><span style=\"background-color: transparent;\">Imaging and Windows update server</span></p><p><span style=\"background-color: transparent;\">Security</span></p><p><span style=\"background-color: transparent;\">KeyScan key card server</span></p><p><span style=\"background-color: transparent;\">VMBullWall</span></p><p><span style=\"background-color: transparent;\">Ransomware monitoring server</span></p><p><span style=\"background-color: transparent;\">VMCA</span></p><p><span style=\"background-color: transparent;\">Certificate authority server for ssl certs</span></p><p><span style=\"background-color: transparent;\">VMCacheServer</span></p><p><span style=\"background-color: transparent;\">Caching server for TestNav</span></p><p><span style=\"background-color: transparent;\">VMCOS</span></p><p><br></p><p><span style=\"background-color: transparent;\">VMFS2</span></p><p><span style=\"background-color: transparent;\">Shared file server</span></p><p><span style=\"background-color: transparent;\">VMGit</span></p><p><br></p><p><span style=\"background-color: transparent;\">VMHOMES2</span></p><p><span style=\"background-color: transparent;\">Roaming profile file server</span></p><p><span style=\"background-color: transparent;\">VMHVAC</span></p><p><span style=\"background-color: transparent;\">HVAC Server</span></p><p><span style=\"background-color: transparent;\">VMMASTERDC</span></p><p><span style=\"background-color: transparent;\">Master domain controller</span></p><p><span style=\"background-color: transparent;\">DHCP Server</span></p><p><span style=\"background-color: transparent;\">Primary DNS server</span></p><p><span style=\"background-color: transparent;\">VMmBook</span></p><p><span style=\"background-color: transparent;\">Yearbook file server</span></p><p><span style=\"background-color: transparent;\">VMRODC</span></p><p><span style=\"background-color: transparent;\">Read-only domain controller</span></p><p><span style=\"background-color: transparent;\">VMWIKI</span></p><p><span style=\"background-color: transparent;\">Old documentation server</span></p><p><span style=\"background-color: transparent;\">webapps</span></p><p><span style=\"background-color: transparent;\">Web server for scholarships</span></p><p><br></p><p><span style=\"background-color: transparent;\">Physical Server</span></p><ul><li><span style=\"background-color: transparent;\">Utils2</span></li><li class=\"ql-indent-1\"><span style=\"background-color: transparent;\">Secondary domain controller</span></li><li class=\"ql-indent-1\"><span style=\"background-color: transparent;\">Secondary DNS server</span></li><li><span style=\"background-color: transparent;\">Docs</span></li><li class=\"ql-indent-1\"><span style=\"background-color: transparent;\">New documentation server</span></li></ul><p><br></p><p><br></p>','06-21-2024','false'),(19,'Windows Desktop Script Setup',_binary '<p>This document will show you how to setup the Powershell script to monitor your Windows computers. </p><p><br></p><p>Goto Desktop or Laptops in the Inventory and click Download</p><p><br></p><p><br></p><p><img src=\"data:image/png;base64,\"></p><p><br></p><p>Extract the zip file and <strong>copy pcinfo.ps1 to C:</strong></p><p><br></p><p>Update the server URL to match your server DNS name or IP address. <strong>DO NOT CHANGE THE HTTP:// or :5500</strong></p><p><br></p><p><img src=\"data:image/png;base64,\"></p><p><br></p><p><br></p><p>Open Task Scheduler and click <strong>Import Task</strong> on the right side. This will run every 30 minutes. You can make any changes to the scheduling that you want to do. </p><p>Click OK to add the task.</p>','06-26-2024','true'),(20,'Linux Script Setup',_binary '<p>SSH into your Linux computer or server.</p><p><br></p><p>Run the command <strong>sudo nano linuxinfo.sh</strong></p><p><br></p><p>Paste the following code</p><p><br></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p><p><strong style=\"color: rgb(230, 0, 0);\">#!/bin/bash</strong></p><p><br></p><p><strong style=\"color: rgb(230, 0, 0);\"># Get the Ubuntu version</strong></p><p><strong style=\"color: rgb(230, 0, 0);\">ubuntu_version=$(lsb_release -d | awk -F\"\\t\" \'{print $2}\')</strong></p><p><br></p><p><strong style=\"color: rgb(230, 0, 0);\"># Get the total memory in GB</strong></p><p><strong style=\"color: rgb(230, 0, 0);\">total_memory=$(free -g | awk \'/^Mem:/{print $2}\')</strong></p><p><br></p><p><strong style=\"color: rgb(230, 0, 0);\"># Get the used memory in GB</strong></p><p><strong style=\"color: rgb(230, 0, 0);\">used_memory=$(free -g | awk \'/^Mem:/{print $3}\')</strong></p><p><br></p><p><strong style=\"color: rgb(230, 0, 0);\"># Get the total disk size in GB</strong></p><p><strong style=\"color: rgb(230, 0, 0);\">total_disk_size=$(df -h --total | grep \'total\' | awk \'{print $2}\')</strong></p><p><br></p><p><strong style=\"color: rgb(230, 0, 0);\"># Get the free disk space in GB</strong></p><p><strong style=\"color: rgb(230, 0, 0);\">free_disk_space=$(df -h --total | grep \'total\' | awk \'{print $4}\')</strong></p><p><br></p><p><strong style=\"color: rgb(230, 0, 0);\"># Get the serial number</strong></p><p><strong style=\"color: rgb(230, 0, 0);\">serial_number=$(sudo dmidecode -s system-serial-number)</strong></p><p><br></p><p><strong style=\"color: rgb(230, 0, 0);\"># Get the processor information</strong></p><p><strong style=\"color: rgb(230, 0, 0);\">processor=$(lscpu | grep \'Model name\' | awk -F: \'{print $2}\' | xargs)</strong></p><p><br></p><p><strong style=\"color: rgb(230, 0, 0);\"># Get the local IP address</strong></p><p><strong style=\"color: rgb(230, 0, 0);\">local_ip=$(hostname -I | awk \'{print $1}\')</strong></p><p><br></p><p><strong style=\"color: rgb(230, 0, 0);\"># Get the hostname</strong></p><p><strong style=\"color: rgb(230, 0, 0);\">hostname=$(hostname)</strong></p><p><br></p><p><strong style=\"color: rgb(230, 0, 0);\"># Get the make and model</strong></p><p><strong style=\"color: rgb(230, 0, 0);\">make=$(sudo dmidecode -s system-manufacturer)</strong></p><p><strong style=\"color: rgb(230, 0, 0);\">model=$(sudo dmidecode -s system-product-name)</strong></p><p><br></p><p><strong style=\"color: rgb(230, 0, 0);\"># Create JSON payload</strong></p><p><strong style=\"color: rgb(230, 0, 0);\">json_payload=$(cat &lt;&lt;EOF</strong></p><p><strong style=\"color: rgb(230, 0, 0);\">{</strong></p><p><strong style=\"color: rgb(230, 0, 0);\">&nbsp;\"os\": \"$ubuntu_version\",</strong></p><p><strong style=\"color: rgb(230, 0, 0);\">&nbsp;\"total_memory_gb\": \"$total_memory\",</strong></p><p><strong style=\"color: rgb(230, 0, 0);\">&nbsp;\"used_memory_gb\": \"$used_memory\",</strong></p><p><strong style=\"color: rgb(230, 0, 0);\">&nbsp;\"total_disk_size_gb\": \"$total_disk_size\",</strong></p><p><strong style=\"color: rgb(230, 0, 0);\">&nbsp;\"free_disk_space_gb\": \"$free_disk_space\",</strong></p><p><strong style=\"color: rgb(230, 0, 0);\">&nbsp;\"serial_number\": \"$serial_number\",</strong></p><p><strong style=\"color: rgb(230, 0, 0);\">&nbsp;\"processor\": \"$processor\",</strong></p><p><strong style=\"color: rgb(230, 0, 0);\">&nbsp;\"local_ip\": \"$local_ip\",</strong></p><p><strong style=\"color: rgb(230, 0, 0);\">&nbsp;\"hostname\": \"$hostname\",</strong></p><p><strong style=\"color: rgb(230, 0, 0);\">&nbsp;\"make\": \"$make\",</strong></p><p><strong style=\"color: rgb(230, 0, 0);\">&nbsp;\"model\": \"$model\"</strong></p><p><strong style=\"color: rgb(230, 0, 0);\">}</strong></p><p><strong style=\"color: rgb(230, 0, 0);\">EOF</strong></p><p><strong style=\"color: rgb(230, 0, 0);\">)</strong></p><p><br></p><p><strong style=\"color: rgb(230, 0, 0);\"># Send JSON payload to the specified URL</strong></p><p><strong style=\"color: rgb(230, 0, 0);\">curl -X POST -H \"Content-Type: application/json\" -d \"$json_payload\" http://10.1.40.17:5500/info/pc</strong></p><p><br></p><p>Make sure to change the last line to match your server dns name or IP address. <strong>Do no change the </strong><strong style=\"background-color: rgb(230, 0, 0); color: rgb(255, 255, 255);\">http:// </strong><strong>or the </strong><strong style=\"color: rgb(255, 255, 255); background-color: rgb(230, 0, 0);\">:5500</strong></p><p><br></p><p>Press CTRL + X  -&gt;  Y -&gt; Enter </p><p><br></p><p>Setting up the schedule </p><p><br></p><p>Enter the command <strong style=\"color: rgb(230, 0, 0);\">sudo crontab -e</strong></p><p><br></p><p>Paste this command <span style=\"color: rgb(230, 0, 0);\"> 30 * * * * sudo ./linuxinfo.sh</span></p><p><br></p><p>Press CTRL + X -&gt; Y -&gt; Enter</p><p><br></p><p><br></p><p><span style=\"color: rgb(255, 255, 255); background-color: rgb(92, 0, 0);\">**Note** Your computer make and model must be in the system for this script to report any information. That can be added in the Settings page under the Inventory tab.</span></p><p><br></p>','06-26-2024','true'),(21,'Mac Script Setup',_binary '<p>Open Teminal</p><p><br></p><p>Run the command <strong style=\"color: rgb(230, 0, 0);\">sudo nano macinfo.sh</strong></p><p><br></p><p>Paste the following code</p><p><br></p><p><br></p><p><span style=\"color: rgb(230, 0, 0);\">#!/bin/bash</span></p><p><br></p><p><span style=\"color: rgb(230, 0, 0);\"># Get the macOS version</span></p><p><span style=\"color: rgb(230, 0, 0);\">macos_version=$(sw_vers -productVersion)</span></p><p><span style=\"color: rgb(230, 0, 0);\">macos_name=$(sw_vers -productName)</span></p><p><br></p><p><span style=\"color: rgb(230, 0, 0);\"># Get the total memory in GB</span></p><p><span style=\"color: rgb(230, 0, 0);\">total_memory=$(sysctl -n hw.memsize | awk \'{print $1 / 1024 / 1024 / 1024}\')</span></p><p><br></p><p><span style=\"color: rgb(230, 0, 0);\"># Get the used memory in GB</span></p><p><span style=\"color: rgb(230, 0, 0);\">used_memory=$(vm_stat | awk \'</span></p><p><span style=\"color: rgb(230, 0, 0);\">/Pages active/ {active=$3}</span></p><p><span style=\"color: rgb(230, 0, 0);\">/Pages inactive/ {inactive=$3}</span></p><p><span style=\"color: rgb(230, 0, 0);\">/Pages speculative/ {speculative=$3}</span></p><p><span style=\"color: rgb(230, 0, 0);\">/Pages wired down/ {wired=$4}</span></p><p><span style=\"color: rgb(230, 0, 0);\">END {</span></p><p><span style=\"color: rgb(230, 0, 0);\">&nbsp;used = (active + inactive + speculative + wired) * 4096 / 1024 / 1024 / 1024</span></p><p><span style=\"color: rgb(230, 0, 0);\">&nbsp;printf(\"%.2f\", used)</span></p><p><span style=\"color: rgb(230, 0, 0);\">}\')</span></p><p><br></p><p><span style=\"color: rgb(230, 0, 0);\"># Get the total hard disk size in GB</span></p><p><span style=\"color: rgb(230, 0, 0);\">total_disk_size=$(diskutil info / | awk \'/Container Total Space/ {print $4}\')</span></p><p><br></p><p><span style=\"color: rgb(230, 0, 0);\"># Get the free disk space in GB</span></p><p><span style=\"color: rgb(230, 0, 0);\">free_disk_space=$(df -H / | awk \'NR==2 {print $4}\')</span></p><p><br></p><p><span style=\"color: rgb(230, 0, 0);\"># Get the serial number</span></p><p><span style=\"color: rgb(230, 0, 0);\">serial_number=$(system_profiler SPHardwareDataType | awk \'/Serial Number \\(system\\)/ {print $4}\')</span></p><p><br></p><p><span style=\"color: rgb(230, 0, 0);\"># Get the processor information</span></p><p><span style=\"color: rgb(230, 0, 0);\">processor=$(sysctl -n machdep.cpu.brand_string)</span></p><p><br></p><p><span style=\"color: rgb(230, 0, 0);\"># Get the local IP address</span></p><p><span style=\"color: rgb(230, 0, 0);\">local_ip=$(ipconfig getifaddr en0)</span></p><p><br></p><p><span style=\"color: rgb(230, 0, 0);\"># Get the hostname</span></p><p><span style=\"color: rgb(230, 0, 0);\">hostname=$(hostname)</span></p><p><br></p><p><span style=\"color: rgb(230, 0, 0);\"># Get the make and model</span></p><p><span style=\"color: rgb(230, 0, 0);\">make=\"Apple\"</span></p><p><span style=\"color: rgb(230, 0, 0);\">model=$(system_profiler SPHardwareDataType | awk -F\": \" \'/Model Name/ {print $2}\')</span></p><p><br></p><p><span style=\"color: rgb(230, 0, 0);\"># Create JSON payload</span></p><p><span style=\"color: rgb(230, 0, 0);\">json_payload=$(cat &lt;&lt;EOF</span></p><p><span style=\"color: rgb(230, 0, 0);\">{</span></p><p><span style=\"color: rgb(230, 0, 0);\">&nbsp;\"macos_version\": \"$macos_version\",</span></p><p><span style=\"color: rgb(230, 0, 0);\">&nbsp;\"macos_name\": \"$macos_name\",</span></p><p><span style=\"color: rgb(230, 0, 0);\">&nbsp;\"total_memory_gb\": \"$total_memory\",</span></p><p><span style=\"color: rgb(230, 0, 0);\">&nbsp;\"used_memory_gb\": \"$used_memory\",</span></p><p><span style=\"color: rgb(230, 0, 0);\">&nbsp;\"total_disk_size_gb\": \"$total_disk_size\",</span></p><p><span style=\"color: rgb(230, 0, 0);\">&nbsp;\"free_disk_space_gb\": \"$free_disk_space\",</span></p><p><span style=\"color: rgb(230, 0, 0);\">&nbsp;\"serial_number\": \"$serial_number\",</span></p><p><span style=\"color: rgb(230, 0, 0);\">&nbsp;\"processor\": \"$processor\",</span></p><p><span style=\"color: rgb(230, 0, 0);\">&nbsp;\"local_ip\": \"$local_ip\",</span></p><p><span style=\"color: rgb(230, 0, 0);\">&nbsp;\"hostname\": \"$hostname\",</span></p><p><span style=\"color: rgb(230, 0, 0);\">&nbsp;\"make\": \"$make\",</span></p><p><span style=\"color: rgb(230, 0, 0);\">&nbsp;\"model\": \"$model\"</span></p><p><span style=\"color: rgb(230, 0, 0);\">}</span></p><p><span style=\"color: rgb(230, 0, 0);\">EOF</span></p><p><span style=\"color: rgb(230, 0, 0);\">)</span></p><p><br></p><p><span style=\"color: rgb(230, 0, 0);\"># Send JSON payload to the specified URL</span></p><p><span style=\"color: rgb(230, 0, 0);\">curl -X POST -H \"Content-Type: application/json\" -d \"$json_payload\" http://127.0.0.1:5500/info/mac</span></p><p><br></p><p><br></p><p><br></p><p>Make sure to change the last line to match your server dns name or IP address. <strong>Do no change the </strong><strong style=\"color: rgb(255, 255, 255); background-color: rgb(230, 0, 0);\">http:// </strong><strong>or the </strong><strong style=\"background-color: rgb(230, 0, 0); color: rgb(255, 255, 255);\">:5500</strong></p><p><br></p><p>Press CTRL + X -&gt; Y -&gt; Enter</p><p><br></p><p>Run command <span style=\"color: rgb(230, 0, 0);\">sudo chmod 755 ./macinfo.sh</span></p><p><br></p><p>Run the command <span style=\"color: rgb(230, 0, 0);\">./macinfo.sh</span></p>','06-26-2024','true');




